script: |
  super -f text -I q8773.spq | sort > q8773.out

inputs:
  - name: q8773.spq
    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE - col0 - - cor0.col0 NOT BETWEEN - col0 + col1 + col2 * + cor0.col0 AND ( - cor0.col0 + col0 + col1 );
  - name: tab2

outputs:
  - name: q8773.out
    data: |
      7	31	27
      78	59	26
      79	17	38
